typedef struct { float x, y, z; } V;
typedef struct { V o, d; } Ray;
typedef struct { V p, n; float t; int h; } Hit;

static V v(float x, float y, float z) { V r = {x, y, z}; return r; }
static V a(V u, V w) { return v(u.x + w.x, u.y + w.y, u.z + w.z); }
static V s(V u, V w) { return v(u.x - w.x, u.y - w.y, u.z - w.z); }
static V m(V u, float k) { return v(u.x * k, u.y * k, u.z * k); }
static float d(V u, V w) { return u.x * w.x + u.y * w.y + u.z * w.z; }
static V nrm(V u) { float l = sqrtf(d(u, u)); return v(u.x / l, u.y / l, u.z / l); }

static Hit sph(Ray r, V c, float rad) {
  V oc = s(r.o, c);
  float A = d(r.d, r.d), B = 2.f * d(oc, r.d), C = d(oc, oc) - rad * rad;
  float q = B * B - 4.f * A * C;
  if (q < 0.f) return (Hit){0};
  float t = (-B - sqrtf(q)) / (2.f * A);
  if (t < 1e-3f) {
    t = (-B + sqrtf(q)) / (2.f * A);
    if (t < 1e-3f) return (Hit){0};
  }
  V p = a(r.o, m(r.d, t));
  return (Hit){p, nrm(s(p, c)), t, 1};
}

static Hit pln(Ray r, float y) {
  if (fabsf(r.d.y) < 1e-4f) return (Hit){0};
  float t = (y - r.o.y) / r.d.y;
  if (t < 1e-3f) return (Hit){0};
  return (Hit){a(r.o, m(r.d, t)), v(0.f, 1.f, 0.f), t, 1};
}

static V sky(Ray r) {
  float t = .5f * (r.d.y + 1.f);
  return a(m(v(1.f, 1.f, 1.f), 1.f - t), m(v(.5f, .7f, 1.f), t));
}

static int shdw(V p, V l, V c, float rad) {
  Ray r = {p, nrm(l)};
  return sph(r, c, rad).h;
}

static V sphcol(Hit h, V l, V c, float rad) {
  float x = .2f + .8f * fmaxf(d(h.n, l), 0.f);
  if (shdw(a(h.p, m(h.n, 1e-3f)), l, c, rad)) x = .2f;
  return v(x, .2f * x, .2f * x);
}

static V trace(Ray r, V c, float rad, float py, V l, int depth) {
  Hit hs = sph(r, c, rad), hp = pln(r, py);
  if (hs.h && (!hp.h || hs.t < hp.t)) return sphcol(hs, l, c, rad);
