    float chk = (((int)(floorf(fabsf(hp.p.x)) + floorf(fabsf(hp.p.z)))) & 1) ? .9f : .4f;
    float x = .2f + .8f * fmaxf(d(hp.n, l), 0.f);
    if (shdw(a(hp.p, m(hp.n, 1e-3f)), l, c, rad)) x = .2f;
    return m(v(chk, chk, chk), x);
  }
  return sky(r);
}

static V **alloc_img(int w, int h) {
  V **img = malloc((size_t)h * sizeof(*img));
  for (int y = 0; y < h; y++) img[y] = malloc((size_t)w * sizeof(**img));
  return img;
}

static void free_img(V **img, int h) {
  for (int y = 0; y < h; y++) free(img[y]);
  free(img);
}

static void wr(const char *fn, V **img, int w, int h) {
  FILE *f = fopen(fn, "w");
  if (!f) { fprintf(stderr, "Error: Could not open file %s for writing\n", fn); return; }
  fprintf(f, "P3\n%d %d\n255\n", w, h);
  for (int y = 0; y < h; y++) for (int x = 0; x < w; x++) {
    int r = (int)(fmin(fmax(img[y][x].x, 0.0), 1.0) * 255.99);
    int g = (int)(fmin(fmax(img[y][x].y, 0.0), 1.0) * 255.99);
    int b = (int)(fmin(fmax(img[y][x].z, 0.0), 1.0) * 255.99);
    fprintf(f, "%d %d %d\n", r, g, b);
  }
  fclose(f);
  fprintf(stderr, "Wrote image to %s\n", fn);
}

int main(void) {
  const int w = 800, h = 600;
  const V sc = {0.f, -.5f, -5.f};
  const float sr = 1.f, py = -1.5f;
  const V l = {1.f / 1.7320508f, 1.f / 1.7320508f, -1.f / 1.7320508f};
